import { BrowserRouter as Router, Routes, Route } from "react-router-dom";




import React from 'react';
import Header from './header';
import PhoneNumber from "./fontpage"



function App() {
  return (
    <Router>

      <Routes>
        <Route path="" element={<PhoneNumber />} />

      </Routes>
    </Router>
  );
}

export default App;
